export const CHAT = 'CHAT';
export const RETURN_WILDCARD_INFO = 'RETURN_WILDCARD_INFO';

export const chatFunctionality = (msg) => (dispatch) => {
    dispatch({ type: CHAT, payload: msg });

    setTimeout(() => {
        dispatch
    }, 2000);
}
